query:
/*+ NoNestLoop(t ci) NoNestLoop(ci t mk) */ select count(*)
from title AS t
inner join cast_info AS ci
on t.id = ci.movie_id AND t.kind_id < 7 AND t.production_year > 1913 AND ci.person_id > 2357812 AND ci.role_id > 2
inner join movie_keyword AS mk
on t.id = mk.movie_id AND mk.keyword_id < 3316;
